import React from "react";
import Carousel from "react-bootstrap/Carousel";
import Slide1 from "../../assets/img/carousal/slide1.webp";
import Slide2 from "../../assets/img/carousal/slide2.webp";
import Slide3 from "../../assets/img/carousal/slide3.webp";
import Scroll_down_component from "../Scroll_down/Scroll_down_component";
import "./crousel_style.css";

const Crousel_component = () => {
  return (
    <div id='home'>
      <Carousel controls={false} indicators interval={2500} pause={false}>
        <Carousel.Item>
          <img
            className='d-block w-100 custom-img'
            src={Slide1}
            alt='First slide'
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className='d-block w-100 custom-img'
            src={Slide2}
            alt='Second slide'
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className='d-block w-100 custom-img'
            src={Slide3}
            alt='Third slide'
          />
        </Carousel.Item>
      </Carousel>
      <Scroll_down_component />
    </div>
  );
};
export default Crousel_component;
